import React from "react";
import { useState } from "react";
import { useRef } from "react";
import { useEffect } from "react";
import ReactAudioPlayer from "react-audio-player";

export default function Latest(){
    return(
        <>
                    <div class="card" style={{width:"15rem"}}>
                       <img src="https://is5-ssl.mzstatic.com/image/thumb/Music114/v4/e3/01/77/e3017729-78d5-3a33-30bc-0a1cfa72366d/886445274585.jpg/400x400cc.jpg" class="card-img-top" alt="..." />
                       <div class="card-body">
                         <h5 class="card-title">Card title</h5>
                         <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                       </div>
                    </div>

                    <ReactAudioPlayer src="https://audio-ssl.itunes.apple.com/itunes-assets/AudioPreview115/v4/12/7a/d7/127ad718-2046-f2ca-26fd-98417504218c/mzaf_16992176741366153247.plus.aac.ep.m4a" controls preload="true" autoPlay/>
        </>
    )
}
